import React from 'react';

function TVShows() {
    return (
        <div style={{ padding: '20px' }}>
            <h2>TV Shows</h2>
            <p>Benvenuti nella sezione dedicata alle serie TV!</p>
        </div>
    );
}

export default TVShows;
